typedef	struct 
{
	unsigned int Left;
	unsigned int Right;
	char* Local;
} IPRangeInfo;

typedef struct 
{
	int Length;
	IPRangeInfo RangeArray[84331];
} IPRangeTree;

IPRangeTree Tree = {0};
static unsigned char InitFlag = 0;

static int isInRange(unsigned int IP,IPRangeInfo Range)
{
	return ((IP >= Range.Left) && (IP <= Range.Right));
}

static int isBigThanRange(unsigned int IP,IPRangeInfo Range)
{
	return IP >= Range.Right;
}

static char* lookup(unsigned int IP,IPRangeTree* Tree,int LeftIndex,int RightIndex)
{
	int Length = (*Tree).Length;
	int MiddleIndex = (LeftIndex + RightIndex)/2;
	IPRangeInfo Range = (*Tree).RangeArray[MiddleIndex];

    // do not find
    if (LeftIndex + 1 == RightIndex)
    {
    	return "not find";
    }
    // continue to find
    else
    {
    	if (isInRange(IP,Range) == 1)
	    {
		    return Range.Local;
	    }
	    else if ((isBigThanRange(IP,Range)) == 1)
	    {
		    return lookup(IP,Tree,MiddleIndex,RightIndex);
	    }
	    else
	    {
		    return lookup(IP,Tree,LeftIndex,MiddleIndex);
	    }
    }
}

